using app.business.Persistence;
using app.domain.Models.EventAggregate.Entities;
using EntityFrameworkCore.Seeder.Base;

namespace app.infrastructure.Persistence.Seeders;

public class PartnersSeeder(IDbContext dbContext, IUnitOfWork unitOfWork) : ISeeder
{
    private readonly IDbContext _dbContext = dbContext;
    private readonly IUnitOfWork _unitOfWork = unitOfWork;

    public async Task SeedAsync()
    {
        var dotnetFoundation = Partner.Create(".NET Foundation", "/assets/sponsors/dotnetfondation.webp", "https://dotnetfoundation.org");
        var jetbrains = Partner.Create("JetBrains", "/assets/sponsors/jetbrainslogo.png", "https://www.jetbrains.com");
        var infiniteSolutions = Partner.Create("Infinite Solutions", "/assets/sponsors/is-logo.png", "https://www.isolutions-intl.com/");
        var mlsa = Partner.Create("Microsoft Learn Student Ambassadors", "data:image/png;base64,", "https://mvp.microsoft.com/studentambassadors");

        await _dbContext.Partners.AddRangeAsync(dotnetFoundation, jetbrains, infiniteSolutions, mlsa);
        await _unitOfWork.SaveChangesAsync();
    }
}
